import React from 'react';
import City from './City.js';

class SecondContent extends React.Component {
    getCities() {
        return ["Barcelona", "New York", "Amsterdam", "Paris"];
    }

    getPictures() {
        return [
            "https://i.ibb.co/KjrSCJG/buenos-aires.jpg",
            "https://i.ibb.co/KjrSCJG/buenos-aires.jpg",
            "https://i.ibb.co/KjrSCJG/buenos-aires.jpg",
            "https://i.ibb.co/KjrSCJG/buenos-aires.jpg"
        ];
    }

    createTable() {
        let table = [];

        for (let i = 0; i < this.getCities().length; i++) {
            table.push(<li>{Math.round(Math.random() * 10)}{<City src={this.getPictures()[i]} name={this.getCities()[i]}/>}</li>)
        }

        return table;
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
